(7, 'XIAOMI Redmi Note 9S ', '\r\nBatterie ultra-haute capacité 5020mAh (type) et charge rapide 18W\r\nQue vous voyagiez, fassiez la navette ou fassiez des courses, une batterie longue durée est indispensable. Avec la batterie ultra-haute capacité 5020mAh (typ), vous pouvez parcourir votre téléphone pendant des heures sans avoir à vous soucier de manquer de puissance. Le Redmi Note 9S prend en charge une charge rapide de 18 W et est équipé d\'un chargeur rapide de 22,5 W dans la boîte.\r\nFiche technique:\r\nProcesseur : \r\n•	Qualcomm® Snapdragon ™ 720G\r\n•	Processeur octa-core hautes performances\r\n•	Fréquence: jusqu\'à 2,3 GHz\r\n•	Processeur graphique Adreno ™ 618\r\n•	Moteur AI Qualcomm® de 5e génération\r\n•	Technologie de processus 8 nm\r\nBatterie :\r\n•	5020mAh (type) \r\n•	Batterie au lithium-ion polymère non amovible intégrée\r\n•	Port de connecteur réversible USB Type-C\r\n•	Prend en charge la charge rapide filaire 18 W\r\n•	Comprend un chargeur de fil de 22,5 W', 'Xiaomi', NULL, 'blanc', '2999.00', 99, , 35, 2);
